service:
  name: remotes1
  identifier: remotes1
  orgIdentifier: default
  projectIdentifier: Project1
  serviceDefinition:
    spec:
      variables:
        - name: servicevar
          type: String
          description: ""
          required: false
          value: <+input>
      manifests:
        - manifest:
            identifier: aaaa
            type: K8sManifest
            spec:
              store:
                type: Github
                spec:
                  connectorRef: account.wingstf
                  gitFetchType: Branch
                  paths:
                    - aaa
                  branch: aaa
              skipResourceVersioning: false
              enableDeclarativeRollback: false
    type: Kubernetes
